import React from "react";
import {
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavbarToggler,
  MDBCollapse,
  MDBNavItem,
  MDBNavLink
} from "mdbreact";
import { connect } from "react-redux";
import "./Home.css";

import Brand from "./Pics/brand.png";

class NavHome extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      collapse: false,
      navtoggle: false
    };
    this.onClick = this.onClick.bind(this);
  }

  componentDidUpdate() {
    if (this.state.collapse) {
      this.setState({
        collapse: !this.state.collapse
      });
    }
  }

  onClick() {
    this.setState({
      navtoggle: !this.state.navtoggle
    });
  }

  render() {
    return (
      <div>
        <MDBNavbar
          className="header"
          expand="md"
          fixed="top"
          scrolling
          transparent
          dark
        >
          <MDBNavbarBrand href="/#">
            <strong>PAXET</strong>
          </MDBNavbarBrand>
          {!this.state.isWideEnough && (
            <MDBNavbarToggler onClick={this.onClick} />
          )}
          <MDBCollapse isOpen={this.state.navtoggle} navbar>
            <MDBNavbarNav right>
              <MDBNavItem>
                <MDBNavLink to="/">Home</MDBNavLink>
              </MDBNavItem>
              <MDBNavItem>
                <MDBNavLink to="/endkunde">Endkunde</MDBNavLink>
              </MDBNavItem>
              <MDBNavItem>
                <MDBNavLink to="/pakethub">Pakethubs</MDBNavLink>
              </MDBNavItem>
              <MDBNavItem>
                <MDBNavLink to="/paketdienstleister">
                  Paketdienstleister
                </MDBNavLink>
              </MDBNavItem>
              <MDBNavItem>
                <MDBNavLink to="/team">Team</MDBNavLink>
              </MDBNavItem>
            </MDBNavbarNav>
          </MDBCollapse>
        </MDBNavbar>
      </div>
    );
  }
}
const mapStateToProps = function(state) {
  return {
    navtoggle: state.navtoggle
  };
};

export default connect()(NavHome);
